  const { isAuthenticated } = useAuth0();
  return (
    <div className="App">

      <Navigation/>
      {!isAuthenticated && <div className='notice'>Welcome, Please Log In for Open Task Manager</div>
}
      {/* <Home/> */}
    </div>
  );
}

export default App;
